import React from 'react';
import './play.css';

class letsPlay extends React.Component {
    render() {
        return (
            <div>
                <h1>Let's Play!</h1>
            </div>
        );
    }
}

class Play extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
        <letsPlay/>
    );
  }
}

export default Play;
